import React, { Fragment } from "react";
import {isAuth, signout} from "./paths/helpers"

import {Link, withRouter} from "react-router-dom";
function Navbar({match, history}) {

    console.log(history.location.pathname)

    const isActive = path =>{
        if(history.location.pathname === path) {
            return {color: "#000"}
        }else {
            return {color: "#f05454"}
        }

        
    }

    const navy = () =>{
        return (
            <div>
            <nav>
            <div className="logo">
            <h1><Link className="logo"  to="/">Montdls</Link></h1>

            </div>
            <div className="links">
            {!isAuth() && (
                <Fragment >
                <Link className="nav-link"   to="/signin" class="btn-login"  >Sign in</Link>
                <Link className="nav-link" to="/signup" class="btn-b" >Sign Up</Link>  
                </Fragment>
            )}

            {isAuth() && (
                <span className="nav-link" onClick={()=>{
                    signout(()=>{
                        history.push("/")
                    })
                }}>Signout</span>
            )}
            </div>
        
        

            </nav>
    
            </div>
        );
    }

    return <div>
    {navy()}
       
    </div>
}

export default withRouter(Navbar);
